"original": |2-
     This attribute specifies the total number of octets processed in
     K octets, i.e., in units of 1024 octets so far.  The value MUST be
     rounded up, so that a Job between 1 and 1024 octets inclusive MUST be
     indicated as being 1, 1025 to 2048 inclusive MUST be 2, etc.
"fixed": |-
  This attribute specifies the total number of octets processed in K octets, i.e., in units of 1024 octets so far.  The value MUST be rounded up, so that a Job between 1 and 1024 octets inclusive MUST be indicated as being 1, 1025 to 2048 inclusive MUST be 2, etc.
"ko": |-
  이 속성은 K 옥텟, 즉 지금까지 1024 옥텟 단위로 처리된 총 옥텟 수를 지정합니다. 값은 반올림되어야 하므로 1~1024 옥텟 사이의 Job은 1, 1025~2048 포함은 2 등으로 표시되어야 합니다.
